import { Injectable } from "@angular/core";
import { HttpClient } from "@angular/common/http";

import { Title } from "@angular/platform-browser";

declare var jquery: any;
declare var $: any;

@Injectable()
export class CommonService {
  // public _hostName = "http://localhost/tamiyoz/api_8/api/";
  // public _hostName = "http://127.0.0.1/tamiyoz-api/";
  public _hostName = "https://tamiyoz.com/api/";
  // public _hostName = 'https://epm-me.com/api/';

  public permissionMsgType = "تنبيه";
  public permissionMsg = "ليس لديك الصلاحية للقيام بهذه المهمة";
  public requestNotFoundMsg = "هذا الطلب غير موجود.";
  public canEditMsg =
    "هذا المحتوى غير موجود ! يرجى التحقق من البيانات المدخلة.";

  public aItemsPerPage = 100;
  public aLinksPerPage = 60;

  public selectedTab = 0;

  public user_id: string = "";
  items: any[];
  projects: any[];
  constructor(private titleService: Title, private http: HttpClient) {
    this.items = this.items instanceof Array ? this.items : [];

    this.projects = this.projects instanceof Array ? this.projects : [];
    if (localStorage.getItem("currentUser") !== null) {
      var currentUser = localStorage.getItem("currentUser");
      var retrievedObject = JSON.parse(currentUser);
      this.user_id = retrievedObject.id;
    }
  }

  public setTitle(newTitle: string) {
    this.titleService.setTitle("Tamiyoz | " + newTitle);
  }

  getUserLevel(data) {
    let body = JSON.stringify(data);
    return this.http.post<any>(
      this._hostName + "admin-api/users.php?action=getUserLevel",
      body
    );
  }

  getAllLanguages() {
    return this.http.get<any>(
      this._hostName + "admin-api/languages.php?action=getAllLanguages"
    );
  }

  getAllCountries() {
    return this.http.get<any>(
      this._hostName + "admin-api/places.php?action=getAllCountries"
    );
  }

  getAllCities(countryId) {
    return this.http.get<any>(
      this._hostName +
        "admin-api/places.php?action=getAllCities&countryId=" +
        countryId
    );
  }

  getHomeStatistics() {
    return this.http.get<any>(
      this._hostName + "admin-api/statistics.php?action=getHomeStatistics"
    );
  }
  getProviderHomeStatistics(id) {
    return this.http.get<any>(
      this._hostName +
        "admin-api/statistics.php?action=getProviderHomeStatistics&provider_id=" +
        id
    );
  }
  getHomeDriversLocations() {
    return this.http.get<any>(
      this._hostName + "admin-api/statistics.php?action=getHomeDriversLocations"
    );
  }

  goToTab(inx) {
    this.selectedTab = inx;
  }

  slug(txt: string) {
    // let str = '#this is_#a test*from$test@test%test(test)test=test&test^test!test+test:test<>/\\{}[]?';
    let new_txt = txt.replace(
      /[#|_| |*|$|@|%|(|)|=|&|^|!|+|:|<|>|/|'\\'|}|{|'['|'\]'|?]/g,
      "-"
    );
    return new_txt;
  }

  limitString(txt: string, txtLength: number) {
    if (txt.length > txtLength) {
      const str = txt.substring(0, txtLength);
      return str + " ...";
    } else {
      return txt;
    }
  }

  ////////////////////////////////////////////////////////////////////////////////////////////////

  check_all(event) {
    if (event.target.checked) {
      var ids = [];
      $('input[class="checkbox_item"]:checkbox').each(function () {
        ids.push($(this).val());
        $(this).prop("checked", true);
      });

      this.items = ids;
    } else {
      $('input[class="checkbox_item"]:checkbox').each(function () {
        $(this).prop("checked", false);
      });
      this.items.length = 0;
    }
  }

  toggleCheckbox(event, id) {
    if (event.target.checked) {
      this.items.push(id);
    } else {
      $('input[class="check_all"]:checkbox:checked').prop("checked", false);
      var index = this.items.indexOf(id);
      if (index > -1) {
        this.items.splice(index, 1);
      }
    }
  }

  toggleCheckboxAddProject(event, obj) {
    if (event.target.checked) {
      this.projects.push(obj);
    } else {
      $('input[class="check_all"]:checkbox:checked').prop("checked", false);
      var index = this.projects.indexOf(obj);
      this.projects = [];
      if (index > -1) {
        this.projects.splice(index, 1);
      }
    }
  }

  ////////////////////////////////////////////////////////////////////////////////////////////////

  range(start, end, step) {
    var range = [];
    var typeofStart = typeof start;
    var typeofEnd = typeof end;

    if (step === 0) {
      throw TypeError("Step cannot be zero.");
    }

    if (typeofStart == "undefined" || typeofEnd == "undefined") {
      throw TypeError("Must pass start and end arguments.");
    } else if (typeofStart != typeofEnd) {
      throw TypeError("Start and end arguments must be of same type.");
    }

    typeof step == "undefined" && (step = 1);

    if (end < start) {
      step = -step;
    }

    if (typeofStart == "number") {
      while (step > 0 ? end >= start : end <= start) {
        range.push(start);
        start += step;
      }
    } else if (typeofStart == "string") {
      if (start.length != 1 || end.length != 1) {
        throw TypeError("Only strings with one character are supported.");
      }

      start = start.charCodeAt(0);
      end = end.charCodeAt(0);

      while (step > 0 ? end >= start : end <= start) {
        range.push(String.fromCharCode(start));
        start += step;
      }
    } else {
      throw TypeError("Only string and number types are supported");
    }

    return range;
  }

  ////////////////////////////////////////////////////////////////////////////////////////////////

  DroidKufi =
    "";
}
